export const HoverStyle=`#Home-Tab:hover {
    color: #000;
    transition: linear 0.2s;
}
#AboutUs-Tab:hover {
    color: #FFA965;
    transition: linear 0.2s;
}
#Projects-Tab:hover {
    color: #7FD6D0;
    transition: linear 0.2s;
}
#Events-Tab:hover {
    color: #C1D37F;
    transition: linear 0.2s;
}
#Blog-Tab:hover {
    color: #FF7171;
    transition: linear 0.2s;
}
#Contacts-Tab:hover {
    color: #FFE99B;
    transition: linear 0.2s;
}`
